import React from 'react';
import ProductList from '../components/ProductList';

const Men = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <div className="text-center mb-8">
        <h1 className="text-4xl font-bold text-main mb-4">Men's Collection</h1>
        <p className="text-secondary">Discover premium footwear for men</p>
      </div>
      <ProductList category="men" />
    </div>
  );
};

export default Men;
